import React from 'react';
import Layout from '../../containers/common/common-layout'
import DetailWrapper from '../../containers/portfolio/detail-wrapper';


const PortfolioDetail4 = () => (
    <Layout pathList={['portfolio details', 'details with slider']} pathTitle="details with slider">
        <DetailWrapper />
    </Layout>
)

export default PortfolioDetail4;
